    false,nt"url": null,nt"notes": "This narrative report for Pablo National
    Wildlife Refuge outlines Refuge accomplishments during the 1978 calendar year. The
    report begins with an introduction to the Refuge and information about climatic
    and habitat conditions. The construction and maintenance section discusses maintenance.
    Habitat management is covered; croplands, grasslands, and wetlands are discussed.
    The wildlife section of the report discusses migratory birds. Interpretation and
    recreation activities are outlined; topics include information and interpretation,
    and recreation. Cooperative programs and items of interest are discussed.",nt"owner_org":
